\u0442\u0443 \u043f\u043e\u0441\u043b\u0435 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B3%D0%B5%D0%BB%D0%BB%D0%B0%D0%BD,_%D0%A4%D0%B5%D1%80%D0%BD%D0%B0%D0%BD\" title=\"\u041c\u0430\u0433\u0435\u043b\u043b\u0430\u043d, \u0424\u0435\u0440\u043d\u0430\u043d\">\u041c\u0430\u0433\u0435\u043b\u043b\u0430\u043d\u0430<\/a>), \u0446\u0435\u043b\u044c\u044e \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0431\u044b\u043b\u0438 \u043f\u043e\u0438\u0441\u043a \u043d\u043e\u0432\u044b\u0445 \u0437\u0435\u043c\u0435\u043b\u044c \u0438 \u043f\u043e\u0434\u0440\u044b\u0432 \u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u043c\u043e\u0433\u0443\u0449\u0435\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1629_%D0%B3%D0%BE%D0%B4\" title=\"1629 \u0433\u043e\u0434\">1629<\/a>&#160;\u2014 \u043c\u0435\u0436\u0434\u0443 \u0420\u0435\u0447\u044c\u044e \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439 \u0438 \u0428\u0432\u0435\u0446\u0438\u0435\u0439 \u043d\u0430\u0434\u043f\u0438\u0441\u0430\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D1%82%D0%BC%D0%B0%D1%80%D0%BA%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%B5%D1%80%D0%B5%D0%BC%D0%B8%D1%80%D0%B8%D0%B5\" title=\"\u0410\u043b\u044c\u0442\u043c\u0430\u0440\u043a\u0441\u043a\u043e\u0435 \u043f\u0435\u0440\u0435\u043c\u0438\u0440\u0438\u0435\">\u0410\u043b\u044c\u0442\u043c\u0430\u0440\u043a\u0441\u043a\u043e\u0435 \u043f\u0435\u0440\u0435\u043c\u0438\u0440\u0438\u0435<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0435\u0435 \u0447\u0435\u0440\u0435\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE-%D1%88%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%B8%D0%B5