8B%D0%B9_%D1%81%D0%B5%D0%BA%D1%80%D0%B5%D1%82%D0%B0%D1%80%D1%8C_%D0%A1%D0%A8%D0%90\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044c \u0421\u0428\u0410\">\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044f<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u044b\u0439 \u0441\u043e\u044e\u0437\">\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043e\u044e\u0437\u0430<\/a>, \u0446\u0435\u043b\u044f\u043c\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0431\u044b\u043b\u0438 \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u0435 \u043d\u0435\u0437\u044b\u0431\u043b\u0435\u043c\u043e\u0441\u0442\u0438 \u0440\u0435\u0448\u0435\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81\" title=\"\u0412\u0435\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\">\u0412\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0430<\/a>, \u043f\u043e\u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u044b\u0445 \u0438 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0439 \u0432 \u0415\u0432\u0440\u043e\u043f\u0435. \u0427\u0443\u0442\u044c \u043f\u043e\u0437\u0436\u0435 \u043a \u0421\u043e\u044e\u0437\u0443 \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0438 \u043f\u043e\u0447\u0442\u0438 \u0432\u0441\u0435 \u043e\u0441\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430. \u041e\u0442\u043a\u0430\u0437\u0430\u043b\u0438\u0441\u044c \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u0442\u044c \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043b\u0438\u0448\u044c \u043f\u0440\u0438\u043d\u0446-\u0440\u0435\u0433\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>, \u0442\u0443\u0440\u0435\u0446\u043a\u0438\u0439 \u0441\u0443\u043b\u0442\u0430\u043d \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439\">\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439<\/a>. \u0418\u0434\u0435\u0439\u043d\u044b\u043c \u0432\u0434\u043e\u0445\u043d\u043e\u0432\u0438\u0442\u0435\u043b\u0435\u043c \u0421\u043e\u044e\u0437\u0430 \u0431\u044b\u043b \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1832_%D0%B3%D0%BE%D0%B4\" title=\"1832 \u0433\u043e\u0434\">1832<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%91%D1%82%D0%B0-%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" title=\"\u0413\u0451\u0442\u0430-\u043a\u0430\u043d\u0430\u043b\">\u0413\u0451\u0442\u0430-\u043a\u0430\u043d\u0430\u043b\u0430<\/a>, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0448\u0432\u0435\u0434\u0430\u043c\u0438<\/a> \u0432\u043e \u0438\u0437\u0431\u0435\u0436\u0430\u043d\u0438\u0435 \u0443\u043f\u043b\u0430\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D1%83%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BE%D1%88%D0%BB%D0%B8%D0%BD%D0%B0\" title=\"\u0417\u0443\u043d\u0434\u0441\u043a\u0430\u044f \u043f\u043e\u0448\u043b\u0438\u043d\u0430\">\u0437\u0443\u043d\u0434\u0441\u043a\u043e\u0439 \u043f\u043e\u0448\u043b\u0438\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1854_%D0%B3%D0%BE%D0%B4\" title=\"1854 \u0433\u043e\u0434\">1854<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8F_(1854%E2%80%941855)\" title=\"\u041e\u0431\u043e\u0440\u043e\u043d\u0430 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044f (1854\u20141855)\">\u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041a\u0440\u044b\u043c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1887_%D0%B3%D0%BE%D0%B4\" title=\"1887 \u0433\u043e\u0434\">1887<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D0%B5%D1%80,_%D0%AD%D0%BC%D0%B8%D0%BB%D1%8C\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\u0435\u0440, \u042d\u043c\u0438\u043b\u044c\">\u042d\u043c\u0438\u043b\u044c \u0411\u0435\u0440\u043b\u0438\u043d\u0435\u0440<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%BC%D0%BC%D0%BE%D1%84%D0%BE%D0%BD\" title=\"\u0413\u0440\u0430\u043c\u043c\u043e\u0444\u043e\u043d\">\u0433\u0440\u0430\u043c\u043c\u043e\u0444\u043e\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/189