ipedia.org\/wiki\/%D0%A1%D0%BB%D1%83%D1%87%D0%B0%D0%B8_%D0%BB%D0%BE%D0%B6%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D1%80%D0%B0%D0%B1%D0%B0%D1%82%D1%8B%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC_%D0%BF%D1%80%D0%B5%D0%B4%D1%83%D0%BF%D1%80%D0%B5%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D1%8F_%D0%BE_%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%BD%D0%BE%D0%BC_%D0%BD%D0%B0%D0%BF%D0%B0%D0%B4%D0%B5%D0%BD%D0%B8%D0%B8\" title=\"\u0421\u043b\u0443\u0447\u0430\u0438 \u043b\u043e\u0436\u043d\u043e\u0433\u043e \u0441\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u043d\u0438\u044f \u0441\u0438\u0441\u0442\u0435\u043c \u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f \u043e \u0440\u0430\u043a\u0435\u0442\u043d\u043e\u043c \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0438\">\u043b\u043e\u0436\u043d\u043e\u0435 \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u043e\u0431 \u0430\u0442\u0430\u043a\u0435<\/a> \u0441\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%90%D0%BD-24_%D0%B2_%D0%A4%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%BC_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0410\u043d-24 \u0432 \u0424\u0438\u043d\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0410\u043d-24 \u0432 \u0424\u0438\u043d\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 10 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_C-130_%D0%BF%D0%BE%D0%B4_%D0%9B%D0%B0%D0%B3%D0%BE%D1%81%D0%BE%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 C-130 \u043f\u043e\u0434 \u041b\u0430\u0433\u043e\u0441\u043e\u043c\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 C-130 \u043f\u043e\u0434 \u041b\u0430\u0433\u043e\u0441\u043e\u043c<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 \u043d\u0435 \u043c\u0435\u043d\u0435\u0435 158 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%AF%D0%BA-40_%D0%BF%D0%BE%D0%B4_%D0%92%D0%B0%D0%BD%D0%B0%D0%B2%D0%B0%D1%80%D0%BE%D0%B9\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u042f\u043a-40 \u043f\u043e\u0434 \u0412\u0430\u043d\u0430\u0432\u0430\u0440\u043e\u0439\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u042f\u043a-40 \u043f\u043e\u0434 \u0412\u0430\u043d\u0430\u0432\u0430\u0440\u043e\u0439<\/a> (\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439). \u041f\u043e\u0433\u0438\u0431\u043b\u0438 28 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u0430<\/a> \u043f\u0440\u0438\u043d\u044f\u0442\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%8B\" title=\"\u0421\u043e\u0432\u0435\